	  .form_wrapper h2 {  font-size: 1.5em;  line-height: 1.5em;  margin: 0;}.form_wrapper .title_container {  text-align: center;  padding-bottom: 15px;}.form_wrapper h3 {  font-size: 1.1em;  font-weight: normal;  line-height: 1.5em;  margin: 0;}.form_wrapper .row {  margin: 10px -15px;}.form_wrapper .row > div {  padding: 0 15px;  box-sizing: border-box;}.form_wrapper .col_half {  width: 50%;  float: left;}.form_wrapper .input_field {  position: relative;  margin-bottom: 20px;}.form_wrapper .input_field > span {  position: absolute;  left: 0;  top: 0;  color: #333;  height: 100%;  border-right: 1px solid #ccc;  text-align: center;  width: 30px;}.form_wrapper .input_field > span > i {  padding-top: 10px;}.form_wrapper .textarea_field > span > i {  padding-top: 10px;}
	  
	  .form_wrapper input[type="text"] {  width: 100%;  padding: 8px 10px 1px 35px;  height: 35px;  border: 1px solid #ccc;  box-sizing: border-box;  outline: none;  -webkit-transition: all 0.30s ease-in-out;  -moz-transition: all 0.30s ease-in-out;  -ms-transition: all 0.30s ease-in-out;  transition: all 0.30s ease-in-out;}
	  
	  .form_wrapper input[type="text"]:focus {  -webkit-box-shadow: 0 0 2px 1px rgb(46, 254, 46);  -moz-box-shadow: 0 0 2px 1px rgb(46, 254, 46);  box-shadow: 0 0 2px 1px rgb(46, 254, 46);  border: 1px solid #088A08;}
	  
	  .form_wrapper input[type="email"],  input[type="password"] {  width: 100%;  padding: 8px 10px 1px 5px;  height: 35px;  border: 1px solid #ccc;  box-sizing: border-box;  outline: none;  -webkit-transition: all 0.30s ease-in-out;  -moz-transition: all 0.30s ease-in-out;  -ms-transition: all 0.30s ease-in-out;  transition: all 0.30s ease-in-out;}
	  
	  .form_wrapper input[type="email"]:focus,  input[type="password"]:focus  {  -webkit-box-shadow: 0 0 2px 1px rgb(46, 254, 46);  -moz-box-shadow: 0 0 2px 1px rgb(46, 254, 46);  box-shadow: 0 0 2px 1px rgb(46, 254, 46);  border: 1px solid #088A08;}.form_wrapper input[type="text"] {  width: 100%;  padding: 8px 10px 9px 35px;  height: 35px;  border: 1px solid #ccc;  box-sizing: border-box;  outline: none;  -webkit-transition: all 0.30s ease-in-out;  -moz-transition: all 0.30s ease-in-out;  -ms-transition: all 0.30s ease-in-out;  transition: all 0.30s ease-in-out;}
	  
	  .form_wrapper input[type="text"]:focus {  -webkit-box-shadow: 0 0 2px 1px rgb(46, 254, 46);  -moz-box-shadow: 0 0 2px 1px rgb(46, 254, 46);  box-shadow: 0 0 2px 1px rgb(46, 254, 46);  border: 1px solid #088A08;} 
	  
	  .form_wrapper input[type="submit"] {  background: #088A08;  height: 35px;  line-height: 35px;  width: 100%;  border: none;  outline: none;  cursor: pointer;  color: #fff;  font-size: 1.1em;  margin-bottom: 10px;  -webkit-transition: all 0.30s ease-in-out;  -moz-transition: all 0.30s ease-in-out;  -ms-transition: all 0.30s ease-in-out;  transition: all 0.30s ease-in-out;}.form_wrapper input[type="submit"]:hover {  background: #2EFE2E;}.form_wrapper input[type="submit"]:focus {  background: #2EFE2E;}
	  
	  .form_wrapper input[type="checkbox"] {  margin-right: 2px;}.form_container .row .col_half.last {  border-left: 1px solid #ccc;}.remember_me {  display: flex;}.forgot_pw {  text-align: right;}.social_btn {  width: 100%;  margin-bottom: 20px;  font-size: 15px;}.social_btn a {  align-items: center;  color: #fff;  display: flex;  height: 35px;  text-decoration: none;}.social_btn a span {  align-items: center;  align-self: stretch;  display: flex;  font-size: 17px;  justify-content: center;  margin-right: 10px;  text-align: center;  width: 35px;}.social_btn.fb {  background: #3b5ca1;}.social_btn.fb span {  background: #314d87;}.social_btn.tw {  background: #45b0e4;}.social_btn.tw span {  background: #26a3df;}.social_btn.gplus {  background: #de4c33;}.social_btn.gplus span {  background: #cc3a21;}.create_account a {  color: #e1a70a;  text-decoration: none;  font-weight: bold;}.bottom_row {  font-size: 0.7em;  color: #ababab;}.bottom_row a {  text-decoration: none;  color: #ababab;}.credit {  position: relative;  z-index: 1;  text-align: center;  padding: 15px;  color: #088A08;}.credit a {  color: #e1a70a;}@media (max-width: 600px) {  .form_wrapper .col_half {    width: 100%;    float: none;  }  .bottom_row .col_half {    width: 50%;    float: left;  }  .form_container .row .col_half.last {    border-left: none;  }  .remember_me {    padding-bottom: 20px;  }} -->
